import React from 'react';

const person = (props)=>{
    return ( 

            <div>
               <p></p>
                <p>{props.children}</p>
                
            </div>



    )


    //<p>I am {props.name} and I am {props.age} years old.</p>
    //<p> I am a person and I am {Math.floor(Math.random() * 30)} years old.</p>

};

export default person;
